import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';




class app extends React.Component{
  render(){
    return(
   <div className='global'>
     <h1>its me</h1>
   </div>
    )
  }

}

ReactDOM.render(
  <app />,
  document.getElementById('root')
);

